package no.nav.pensjon.testdata.configuration.support;

public class Environment {

    private String env;
    private String url;

    public String getEnv() {
        return env;
    }

    public void setEnv(String env) {
        this.env = env;
    }

    public String getUrl() {
        return url;
    }

    public void setUrl(String url) {
        this.url = url;
    }
}
